import {
	Head,
	HomeProfile,
	ProfileAvatar,
	Avatar,
} from "../../container/style";

interface IHeader {
	disable: boolean;
}
const Header: React.FC<IHeader> = (props) => {
	return (
		<>
			<Head color="rgb(1, 169, 244)" display={props.disable}>
				<HomeProfile>Restaurant Reservation</HomeProfile>
				<ProfileAvatar>
					<Avatar>DS</Avatar>
				</ProfileAvatar>
			</Head>
		</>
	);
};
export default Header;
